  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent datan               set, or they can be combined to cover the entire
  nation.nn               Metropolitan and Micropolitan Statistical Areas are together
  termed Core Based Statistical Areas (CBSAs) and are defined by the Office of Management
  andn               Budget (OMB) and consist of the county or counties or equivalent
  entities associated with at least one urban core (urbanized area or urban cluster)
  of atn               least 10,000 population, plus adjacent counties having a high
  degree of social and economic integration with the core as measured through commuting
  tiesn               with the counties containing the core.  Categories of CBSAs
  are: Metropolitan Statistical Areas, based on urbanized areas of 50,000 or more
  population;n               and Micropolitan Statistical Areas, based on urban clusters
  of at least 10,000 population but less than 50,000 population.  nn               The
  CBSAs boundaries are those defined by OMB based on the 2010 Census and published
  in 2013.n            \",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
